import React from 'react';
import {render}  from 'react-dom';

 function Inputs () {
    return (
        <div style={{marginLeft:'30px'}}>
            <input style={{width:"50"}} style={{marginTop:'30px'}} placeholder="name"></input>
            <br />
            <input style={{width:"50"}} style={{marginTop:'30px'}} placeholder="content"></input>
            <br />           
            <input style={{width:"50"}} style={{marginTop:'30px'}} placeholder="url"></input>
            <br />
            <input style={{width:"50"}} style={{marginTop:'30px'}} placeholder="source"></input>
            <br />
            <input style={{width:"50"}} style={{marginTop:'30px'}} placeholder="type"></input>
            <br />
            <button style={{marginTop:'30px'}}>提交</button>
        </div>
    )
}
export default Inputs
